import React from 'react';
import '../css/home.css'
import Header from '../components/Header';
import girl1 from '../imgs/girl1.jpg';

function Home() {
    return(
      <section>
        <Header />
        <div className="imgcover">
          <h2>Fresh is beauty</h2>
          <img src={girl1} alt="homepage" />
        </div>
        <div></div>
      </section>
    );
  }

  export default Home;
